import React, { useState } from 'react';
import { Label, LabelText, Input } from 'govuk-react';
import MyBtn from '../MyBtn';
import MyUpdateButton from '../MyUpdateButton';

function UpdateMedicalRecordsPage() {

    const [nhsNumber, setNhsNumber] = useState('');
    const [forename, setForename] = useState('');
    const [surname, setSurname] = useState('');
    const [personDOB, setPersonDOB] = useState('');
    const [genderCode, setGenderCode] = useState('');
    const [postcode, setPostcode] = useState('');

    function handleCallBack(myNhsNumber) {
        setNhsNumber(myNhsNumber);
    }
    function onChangeCapture(e) {
        setNhsNumber(e.target.value);
    }
    function handleChangeForename(e) {
        setForename(e.target.value);
    }

    function handleChangeSurname(e) {
        setSurname(e.target.value);
    }

    function handleChangePersonDOB(e) {
        setPersonDOB(e.target.value);
    }

    function handleChangeGenderCode(e) {
        setGenderCode(e.target.value);
    }

    function handleChangePostcode(e) {
        setPostcode(e.target.value);
    }


    return (
        <>
            <div className="updateMedicalRecordsContainer">
                {/* Rest of your component code */}
                <div id="viewMedicalRecordsNhsNumberFieldInput">
                    <Label />
                    <LabelText><strong>Enter your NHS Number to choose your medical record:</strong></LabelText>
                    <Input value={nhsNumber} onChange={onChangeCapture} />
                </div>
                <br/>
                <MyBtn nhsNumber={nhsNumber} callback={handleCallBack} />
                <div id="updateMedicalRecordsFieldsInputs">
                    <Label/>
                    <LabelText>doseNumber:</LabelText>
                    <Input type="text" value={doseNumber} onChange={doseNumber} />
                    <br />
                    <label />
                    <LabelText>vaccinationDate:</LabelText>
                    <Input type="text" value={vaccinationDate} onChange={vaccinationDate} />
                    <br />
                    <label />
                    <LabelText>countryOfVaccination:</LabelText>
                    <Input type="text" value={countryOfVaccination} onChange={countryOfVaccination} />
                    <br />
                    <label />
                    <LabelText>authority:</LabelText>
                    <Input type="text" value={authority} onChange={authority} />
                    <br />
                    <label />
                    <LabelText>site:</LabelText>
                    <Input type="text" value={site} onChange={site} />
                    <br />
                    <label />
                    <LabelText>totalSeriesOfDoses:</LabelText>
                    <Input type="text" value={totalSeriesOfDoses} onChange={totalSeriesOfDoses} />
                    <br />
                    <label />
                    <LabelText>displayName:</LabelText>
                    <Input type="text" value={displayName} onChange={displayName} />
                    <br />
                    <label />
                    <LabelText>snomedCode:</LabelText>
                    <Input type="text" value={snomedCode} onChange={snomedCode} />
                    <br />
                    <label />
                    <LabelText>dateEntered:</LabelText>
                    <Input type="text" value={dateEntered} onChange={dateEntered} />
                    <br />
                    <label />
                    <LabelText>procedureCode:</LabelText>
                    <Input type="text" value={procedureCode} onChange={procedureCode} />
                    <br />
                    <label />
                    <LabelText>booster:</LabelText>
                    <Input type="text" value={booster} onChange={booster} />
                    <br />
                    <label />
                    <LabelText>vaccineId:</LabelText>
                    <Input type="text" value={vaccineId} onChange={vaccineId} />
                    <br />

                </div>
                <br/>
                <MyUpdateButton
                    forename={forename}
                    surname={surname}
                    personDOB={personDOB}
                    genderCode={genderCode}
                    postcode={postcode}
                    callback={handleChangeForename, handleChangeSurname, handleChangePersonDOB, handleChangeGenderCode, handleChangePostcode}
                />
            </div>

        </>
    );
}

export default UpdateMedicalRecordsPage;
